findStrings.find:
long time \= countDragon\%100 \=\= 0 \? countDragon\%100 \: countDragon\%100 \+ 1\;
 long count \= 0\;
 Set\<String\> codeMap \= new HashSet\<\>\(\)\;
 while\(count \<\= time\) \{
 PageInfo page \= new PageInfo\(\)\;
 page\.setPage\(\(int\)count\)\;
 page\.setCount\(100\)\;
 List\<DragonInfo\> dragons \= session\.selectList\("selectCodeFromDragon"\, page\)\;

 for\(DragonInfo dragon \: dragons\) \{
 codeMap\.add\(dragon\.getDragon1_code\(\)\)\;
 codeMap\.add\(dragon\.getDragon2_code\(\)\)\;
 codeMap\.add\(dragon\.getDragon3_code\(\)\)\;
 \}
 count \= \(count\+\+\)\*100\;
 \}
